import React, { Fragment } from 'react';
import './App.css';
import Navbar from './component/layout/Navbar.js';
import Landing from './component/layout/landing.js'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <Fragment>
        <Landing />
        <Navbar />
      </Fragment>
    </Router>
  );
}

export default App;
